import React from 'react';
import styled from 'styled-components'

const HomePageContainer = styled.div`
    display: flex;
    flex-direction: column wrap;
    padding: 10px;
`


const HomePage = () => {
    return (
        <HomePageContainer>
            <h2 className="main-header">Check out our community!</h2>
        </HomePageContainer>
    )
}

export default HomePage
